$(function(){$.sweetAlert=(()=>({info:async(t,n)=>{const i={icon:"info",confirmButtonText:"确 定",text:t||"",title:n||"提 示"};try{await Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text"},buttonsStyling:!1}).fire(i),callback&&callback()}catch(t){}},success:async(t,n)=>{const i={icon:"success",confirmButtonText:"确 定",text:t||"",title:n||"通 知"};try{await Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text"},buttonsStyling:!1}).fire(i)}catch(t){}},warn:async(t,n)=>{const i={icon:"warning",confirmButtonText:"确 定",text:t||"",title:n||"警 告"};try{await Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text"},buttonsStyling:!1}).fire(i)}catch(t){}},error:async(t,n)=>{const i={icon:"error",confirmButtonText:"确 定",text:t||"",title:n||"错 误"};try{await Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text"},buttonsStyling:!1}).fire(i)}catch(t){}},confirm:async(t,n)=>{const i={icon:"warning",showCancelButton:!0,confirmButtonText:"确 定",cancelButtonText:"取 消",text:t||"",title:n||"通 知"};try{let t=await Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text mr-4",cancelButton:"btn btn-secondary swal-btn-text"},buttonsStyling:!1}).fire(i);return t.isConfirmed}catch{return!1}},custome:t=>Swal.mixin({customClass:{confirmButton:"btn btn-info swal-btn-text mr-4",cancelButton:"btn btn-secondary swal-btn-text"},buttonsStyling:!1}).fire(t),_this:Swal}))});